            return (
            <div>
                <div className='doc'>
                    <ol>{index}</ol>
                    <lu style={{ color: 'red' }}> Name user: {element.user}</lu>
                    <lu>title: {element.title}</lu>
                    <p> content:  {element.content}</p>
                    </div>
                    <br></br>
            </div>
                    );
                },);
